■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><br /><td><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/number_only_02/0217463-01.gif" width="600" height="540"><br><br /><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/number_only_02/0217463-02.jpg" width="600" height="540"><br><br /><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/number_only_02/0217463-03.jpg" width="600" height="553"><br><br /><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/number_only_02/0217463-04.jpg" width="600" height="527"></td><br /></tr></table><br><table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><br /><td><h1><font color="#333333" size="3">防炎仏壇マットがあればお仏壇まわりの「万が一」の時も安心。ローソクが倒れても、線香が落ちても燃えずこげることもありません。お手入れもラクラク。</font></h1></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><br /><td><font color="#333333" size="-1">火のついたローソク、お線香・・・お仏壇のまわりには実は見逃せない火の危険が！このマットがあれば万が一の時も安心。ローソクが倒れても、線香が落ちても燃えずこげることもありません。お手入れもラクラク。</font></td><br /></tr></table><br><br /><br /><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><br /><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><br /><td width="75%" align="left"><font color="#333333" size="-1">24.5×37.5×0.3cm</font></td></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><br /><td align="left"><font color="#333333" size="-1">48g</font></td></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><br /><td align="left"><font color="#333333" size="-1">ガラス繊維、アルミ箔、PETフィルム、不織布</font></td><br /></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><br /><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
